// frontend/src/components/dashboard/Dashboard.js
import React, { useEffect } from 'react';

const Dashboard = ({ user, setCurrentPage }) => {
  // Use useEffect to set the current page when component mounts
  useEffect(() => {
    console.log('Dashboard mounted, setCurrentPage type:', typeof setCurrentPage);
    if (setCurrentPage && typeof setCurrentPage === 'function') {
      console.log('Setting current page to dashboard');
      setCurrentPage('dashboard');
    }
  }, [setCurrentPage]);

  return (
    <div className="p-6">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Dashboard</h1>
        <p className="text-gray-600">Welcome back, {user?.name}!</p>
      </div>
      
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        {/* Dashboard cards would go here */}
        <div className="bg-white rounded-xl p-6 shadow-sm border">
          <h3 className="text-lg font-semibold text-gray-900">Equipment</h3>
          <p className="text-2xl font-bold text-teal-600">0</p>
        </div>
        
        <div className="bg-white rounded-xl p-6 shadow-sm border">
          <h3 className="text-lg font-semibold text-gray-900">Maintenance</h3>
          <p className="text-2xl font-bold text-teal-600">0</p>
        </div>
        
        <div className="bg-white rounded-xl p-6 shadow-sm border">
          <h3 className="text-lg font-semibold text-gray-900">Tasks</h3>
          <p className="text-2xl font-bold text-teal-600">0</p>
        </div>
        
        <div className="bg-white rounded-xl p-6 shadow-sm border">
          <h3 className="text-lg font-semibold text-gray-900">Users</h3>
          <p className="text-2xl font-bold text-teal-600">0</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
